import { useForm } from 'react-hook-form';
import { Row, Col, Card, Form, FloatingLabel, InputGroup, Button, Dropdown, DropdownButton } from 'react-bootstrap';
import classNames from 'classnames';

// hooks
import { usePageTitle } from '../../hooks';

// components
import { FormInput } from '../../components/form';

type Colors = {
    variant: string;
    name: string;
};

const BasicInputElements = () => {
    /*
     * form methods
     */
    const methods = useForm({
        defaultValues: {
            password: '12345',
            statictext: 'email@example.com',
            color: '#35b8e0',
        },
    });
    const {
        handleSubmit,
        register,
        control,
        formState: { errors },
    } = methods;

    return (
        <Card>
            <Card.Body>
                <h4 className="header-title">Input Types</h4>
                <p className="sub-header">
                    Most common form control, text-based input fields. Includes support for all HTML5 types:{' '}
                    <code>text</code>, <code>password</code>, <code>datetime</code>, <code>datetime-local</code>,{' '}
                    <code>date</code>, <code>month</code>, <code>time</code>, <code>week</code>, <code>number</code>,{' '}
                    <code>email</code>, <code>url</code>, <code>search</code>, <code>tel</code>, and <code>color</code>.
                </p>

                <Row>
                    <Col lg={6}>
                        <form onSubmit={handleSubmit(() => {})}>
                            <FormInput
                                label="Text"
                                type="text"
                                name="text"
                                containerClass={'mb-3'}
                                register={register}
                                key="text"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Email"
                                type="email"
                                name="email"
                                placeholder="Email"
                                containerClass={'mb-3'}
                                register={register}
                                key="email"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Show/Hide Password"
                                type="password"
                                name="password"
                                placeholder="password placeholder"
                                containerClass={'mb-3'}
                                register={register}
                                key="password"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Placeholder"
                                type="text"
                                name="placeholder"
                                placeholder="placeholder"
                                containerClass={'mb-3'}
                                register={register}
                                key="placeholder"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Text Area"
                                type="textarea"
                                name="textarea"
                                rows={5}
                                containerClass={'mb-3'}
                                register={register}
                                key="textarea"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Read only"
                                type="text"
                                name="text1"
                                id="text1"
                                placeholder="Readonly value"
                                readOnly
                                containerClass={'mb-3'}
                                register={register}
                                key="text1"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Disabled"
                                type="text"
                                name="text2"
                                id="text2"
                                placeholder="Disabled value"
                                disabled
                                containerClass={'mb-3'}
                                register={register}
                                key="text2"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Static control"
                                type="text"
                                name="statictext"
                                placeholder="Disabled"
                                readOnly
                                containerClass={'mb-3'}
                                register={register}
                                key="statictext"
                                errors={errors}
                                control={control}
                            />

                            <Form.Group className="mb-3">
                                <Form.Label htmlFor="text3" className="form-label">
                                    Helping text
                                </Form.Label>
                                <Form.Control type="text" name="text" id="text3" placeholder="Helping text" />
                                <Form.Text>
                                    A block of help text that breaks onto a new line and may extend beyond one line.
                                </Form.Text>
                            </Form.Group>
                        </form>
                    </Col>

                    <Col lg={6}>
                        <form onSubmit={handleSubmit(() => {})}>
                            <FormInput
                                name="select"
                                label="Input Select"
                                type="select"
                                containerClass="mb-3"
                                className="form-select"
                                register={register}
                                key="select"
                                errors={errors}
                                control={control}
                            >
                                <option>1</option>
                                <option>2</option>
                                <option>3</option>
                                <option>4</option>
                                <option>5</option>
                            </FormInput>

                            <FormInput
                                name="selectMulti"
                                label="Multiple Select"
                                type="select"
                                multiple
                                containerClass="mb-3"
                                className="form-select"
                                register={register}
                                key="selectMulti"
                                errors={errors}
                                control={control}
                            >
                                <option>1</option>
                                <option>2</option>
                                <option>3</option>
                                <option>4</option>
                                <option>5</option>
                            </FormInput>

                            <FormInput
                                label="Default file input"
                                type="file"
                                name="file"
                                containerClass={'mb-3'}
                                register={register}
                                key="file"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Date"
                                type="date"
                                name="date"
                                containerClass={'mb-3'}
                                register={register}
                                key="date"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Month"
                                type="month"
                                name="month"
                                containerClass={'mb-3'}
                                register={register}
                                key="month"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Time"
                                type="time"
                                name="time"
                                containerClass={'mb-3'}
                                register={register}
                                key="time"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Week"
                                type="week"
                                name="week"
                                containerClass={'mb-3'}
                                register={register}
                                key="week"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Number"
                                type="number"
                                name="number"
                                placeholder="number placeholder"
                                containerClass={'mb-3'}
                                register={register}
                                key="number"
                                errors={errors}
                                control={control}
                            />

                            <FormInput
                                label="Color"
                                type="color"
                                name="color"
                                className="w-100"
                                placeholder="color placeholder"
                                containerClass={'mb-3'}
                                register={register}
                                key="color"
                                errors={errors}
                                control={control}
                            />

                            <Form.Group className="mb-0">
                                <Form.Label htmlFor="exampleRange" className="form-label">
                                    Range
                                </Form.Label>
                                <Form.Range />
                            </Form.Group>
                        </form>
                    </Col>
                </Row>
            </Card.Body>
        </Card>
    );
};

const FloatingLabels = () => {
    return (
        <Card>
            <Card.Body>
                <h4 className="header-title">Floating labels</h4>
                <p className="sub-header">
                    Wrap a <code>&lt;Form.Control&gt;</code> element in <code>&lt;FloatingLabel&gt;</code>
                    to enable floating labels with Bootstraps textual form fields. A <code>placeholder</code>
                    is required on each <code>&lt;Form.Control&gt;</code> as our method of CSS-only floating labels uses
                    the <code>:placeholder-shown</code> pseudo-element.
                </p>

                <Row>
                    <Col lg={6}>
                        <h5 className="mb-3">Floating Example</h5>
                        <FloatingLabel controlId="floatingInput" label="Email address" className="mb-3">
                            <Form.Control type="email" placeholder="name@example.com" />
                        </FloatingLabel>
                        <FloatingLabel controlId="floatingPassword" label="Password" className="mb-3">
                            <Form.Control type="password" placeholder="Password" />
                        </FloatingLabel>
